import 'package:flutter_thrio/flutter_thrio.dart';

/// a struct description a people
///
class People {
  People({
    required this.name,
    required this.age,
    required this.sex,
  });

  factory People.fromMap(final Map<String, dynamic> json) => People(
        name: getValue<String>(json, 'name'),
        age: getValue<int>(json, 'age'),
        sex: getValue<String>(json, 'sex'),
      );

  final String name;

  final int age;

  final String sex;

  Map<String, dynamic> toMap() => <String, dynamic>{
        'name': name,
        'age': age,
        'sex': sex,
      };
}
